#![allow(non_snake_case)]

use std::{env, fs, ops::Sub};

fn main() {

    let input : String = fs::read_to_string(&env::args().collect::<Vec<String>>()[1]).unwrap();

    if input.as_str().starts_with("@666") {
        println!("El analizador lexicografico reporto un error, no es posible empezar con el analisis sintatico");
        panic!()
    }

    let tokens = input.split("\n")
        .enumerate()
        .filter(|(i,_v)| i%2 == 0)
        .map(|(_i,v)| v.to_string())
        .collect::<Vec<String>>()
        .join(" ");

    ParserSLR::new().parse(tokens.as_str());

}

